// src/pages/Pricing.js
import { useNavigate } from "react-router-dom";

export default function Pricing() {
  const navigate = useNavigate();

  return (
    <main style={{ maxWidth: 700, margin: '2rem auto', padding: '0 1rem' }}>
      <h2>Choose Your Path</h2>

      <div style={{
        display: 'flex', flexDirection: 'column', gap: '1.5rem',
        marginTop: '1.5rem'
      }}>
        {/* Free Plan */}
        <div style={{
          border: '1px solid #ccc', borderRadius: 8, padding: '1rem',
          backgroundColor: '#f9f9f9'
        }}>
          <h3>Free Plan</h3>
          <p>Ask 3 questions complimentary</p>
        </div>

        {/* Monthly Plan */}
        <div style={{
          border: '1px solid #0070f3', borderRadius: 8, padding: '1rem',
          backgroundColor: '#e6f0ff'
        }}>
          <h3>PowerWithin Monthly (Rs. 650/month)</h3>
          <p>Unlimited questions</p>
          <button onClick={() => navigate('/ask')} style={{
            backgroundColor: '#0070f3',
            color: 'white',
            border: 'none',
            padding: '0.6rem 1.2rem',
            borderRadius: 5,
            cursor: 'pointer',
            marginTop: '0.5rem'
          }}>
            Upgrade Now
          </button>
        </div>

        {/* Premium Plan */}
        <div style={{
          border: '1px solid #ff9800', borderRadius: 8, padding: '1rem',
          backgroundColor: '#fff3e0'
        }}>
          <h3>PowerWithin Premium (Rs. 2,999/year)</h3>
          <p>Unlimited questions</p>
          <p>Deeper personalization</p>
          <p>Mantras & stories for you</p>
          <button onClick={() => navigate('/ask')} style={{
            backgroundColor: '#ff9800',
            color: 'white',
            border: 'none',
            padding: '0.6rem 1.2rem',
            borderRadius: 5,
            cursor: 'pointer',
            marginTop: '0.5rem'
          }}>
            Upgrade Now
          </button>
        </div>
      </div>
    </main>
  );
}
